from app.mktcore.mdlimports import *

class MKT_DISBURSE(exmodel):
	ID 					=	db.Column(db.String(14), primary_key=True)
	Officer				=	db.Column(db.String(10))
	OfficerAccount		= 	db.Column(db.String(20))
	OfficerCategory 	= 	db.Column(db.String(15))
	Currency			=	db.Column(db.String(3))
	ValueDate 			= 	db.Column(db.String(45))
	TotalDisbursement 	= 	db.Column(db.Numeric(25, 9))
	TotalActualAmount 	= 	db.Column(db.Numeric(25, 9))
	OptionGroupby 		= 	db.Column(db.String(1))
	DisbursedStatus		= 	db.Column(db.String(1))
	VBID 				= 	db.Column(db.String(10))
	Group 				= 	db.Column(db.String(15))
	AdvanceStatus 		= 	db.Column(db.String(1))

